#include<bits/stdc++.h>
using namespace std;
 string isPrime(int n ){
    if(n<2){
        return "Not prime";
    }else{
        if(n==2 || n==3){
            return "Prime";
        }else{
            for(int i=3; i<n; i++){
                if(n%i==0){
                return "Not prime";
                }
            }
        }
    }
    return "prime";
 }
int main()
{
    int n;
    cin >> n;
    cout<<isPrime(n)<<endl;
 
    return 0;
}